import React from "react";
import { Link } from "react-router-dom";
import {
  PageContainer,
  Title,
  HeadlineContainer,
  Subtitle,
  Demo,
  Video,
  ContentContainer1,
  ContentContainer2,
  ContentContainer3,
  SubContainer,
} from "./styles/index_style.js";
import ReactPlayer from "react-player";
import landing_video from "../imgs/landing_video.mp4";
import before from "../imgs/ais_only.png";
import Card from "react-bootstrap/Card";

function Home() {
  return (
    <>
      <PageContainer>
        <Video src={landing_video} autoPlay loop muted playsinline />
        <HeadlineContainer>
          <Title>The Future of Maritime Navigation</Title>
          <Demo to="/contact">Schedule a Demo</Demo>
        </HeadlineContainer>
      </PageContainer>
      <ContentContainer1>
        <SubContainer>
          <Subtitle>Navigate the Ocean like Never Before</Subtitle>
          <Card style={{ width: "18rem" }}>
            <Card.Img variant="top" src="holder.js/100px180" />
            <Card.Body>
              <Card.Title>Card Title</Card.Title>
              <Card.Text>
                Some quick example text to build on the card title and make up
                the bulk of the card's content.
              </Card.Text>
            </Card.Body>
          </Card>
        </SubContainer>
      </ContentContainer1>
    </>
  );
}

export default Home;
